import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import GetImagen from './GetImagen';

class App extends Component {
  state = {
    gatitos: []
  }
  componentDidMount() {
    this.setState({ gatitos: new Array(60) })

  }
  render() {
    const { gatitos } = this.state
    return (
      <div className="App">
        {gatitos => imagen}
        <GetImagen
          imagen="https://bulma.io/images/placeholders/128x128.png"

        >
        </GetImagen>
      </div>
    );
  }
}

export default App;
